text:
Americans are now facing the highest unemployment rate since 2021 and the slowest non-COVID job growth since 2010.

Working families are being squeezed by high prices on basic necessities and they're worried.

@POTUS needs to stop damaging our economy and end his trade war.

Tariffs are taxes.

They're paid by American consumers, and they increase prices on everyday goods.

@POTUS and Congressional Republicans are bragging about American families paying more and having less money in their pockets.
